import React from 'react'
import styled from 'styled-components'

const Accordions: React.FC = () => {
  return (
    <RowContainer>
      <ColContent>
        <Text>
          Empresa
        </Text>
      </ColContent>
    </RowContainer>
  );
}

export default Accordions

const RowContainer = styled.div`
  display: flex;
`;

const ColContent = styled.div`
  flex: 1;
  &:last-child {
    margin-left: 1em;
  }
`;

const Text = styled.h2`
  margin: 0 0 .5em;
  font-weight: normal;
`;
